import React from "react";

class Pradinis extends React.Component {
  render() {
    return (
      <>
        <h2>Tai yra pradinis puslapis</h2>
        <hr />
        <p>Cia panaudotas klases komponentas</p>
      </>
    );
  }
}

export default Pradinis;
